import React from "react";
import { Container, Col, Row } from "react-bootstrap";

const Footer = () => {
  return (
    <>
      <Footer>
        <Container>
          <Row>
            <Col className="text-center py-3">Copyright &copy</Col>
          </Row>
        </Container>
      </Footer>
    </>
  );
};

export default Footer;
